Ski season is not over yet, folks! There’s still time to book a spring getaway at any of the four New Hampshire ski resorts on the @epicpass. 

@wildcatmountain was a new one for me, and it is an absolute gem. My friends and I had so much fun skiing down iconic runs with Mount Washington and Tuckerman’s Ravine in the distance. There were easier greens and more challenging blues, (and black diamonds too!), good food at the lodge, and lovely staff to help make your ski day phenomenal. Epic Pass makes it easy and affordable to enjoy an array of mountains and experiences. Now is a perfect time to get out and enjoy sliding down mountains on skis or snowboards out east!

I’m already dreaming about next season’s adventures. Get your 23/24 #EpicPass or #EpicDayPass now for the best deal compared to lift tickets next season. #ad

