@rebeccasprivateidaho — A BLAST.
This might have been the first bike race where I had almost NO anxiety beforehand. My strategy was to TAKE MY TIME AND CHILL, which is exactly what I did. And with that came enjoyment, a little hard breathing from time to time, a new mantra (THIS CLIMB IS MY FAVORITE!), more in the saddle time and less pushing of the my bike, more joyful conversations with folks, and a feeling of gratitude as the mountains showed off. And then afterwards I had what I really came for, a Ketchum BURRITO, because what is a bike race without a finisher’s burrito? Yeah, I don’t know either. What a great week and lead up to RPI, a fantastic experience for all levels of rider. See you NEXT YEAR!!

